import React from 'react';

import {
   Paper, Card,
   CardMedia, CardContent
} from '@mui/material';

export default function Webcams(props) {
   return (
      <Paper style={{ display: 'flex', }}>
         {props.webcams.map(cam => {
            return (
               <Card sx={{ maxWidth: 300 }}>
                  <CardMedia component='img'
                     image={cam.image}
                     alt='resort traffic webcam'>
                  </CardMedia>
                  <CardContent>
                     {cam.name}
                  </CardContent>
               </Card>
            )
         })}
      </Paper>
   );
}
